import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";

const root = ReactDOM.createRoot(document.getElementById("root"));

console.log("Root Render");
root.render(
	<React.StrictMode>
		<App />
	</React.StrictMode>
);
